import Container from "@mui/material/Container";
import { Routes, Route } from "react-router-dom";

import React from "react";
import { Header } from "./components";
import PrivateRoute from "./components/PrivateRoute/PrivateRoute";
import { Home, Registration, Login, AddRasp,AddTime, AddPredmet } from "./pages";
import { useDispatch, useSelector } from "react-redux";
import { fetchAuthMe, selectIsAuth } from "./redux/slices/auth";
import { AddGroup } from "./pages/AddGroup";
import { AddTeacher } from "./pages/AddTeacher";



function App() {
  const dispatch = useDispatch();
  const isAuth = useSelector(selectIsAuth);

  React.useEffect(() => {
    dispatch(fetchAuthMe());
  }, []);
  return (
    <>
      <Header />
      <Container maxWidth="lg">
        <Routes>
        <Route path="/" element={<Home />} />

          <PrivateRoute path="/rasps/:id/edit" component={<AddRasp />} />
          <PrivateRoute path="/add-rasp" component={<AddDay />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Registration />} />
          <PrivateRoute path="/add-time" component={AddTime} />
          <PrivateRoute path="/times/:id/edit" component={AddTime} />
          <PrivateRoute path="/add-predmet" component={AddPredmet} />
          <PrivateRoute path="/predmets/:id/edit" component={AddPredmet} />
          <PrivateRoute path="/add-group" component={AddGroup} />
          <PrivateRoute path="/groups/:id/edit" component={AddGroup} />
          <PrivateRoute path="/add-teacher" component={AddTeacher} />
          <PrivateRoute path="/teachers/:id/edit" component={AddTeacher} />
        </Routes>
      </Container>
    </>
  );
}

export default App;
